Ч. 3 ст. 327 УК РФ Использование заведомо подложного документа; 

ч. 3 ст. 142 УК РФ Незаконное изготовление, а равно хранение либо перевозка незаконно изготовленных избирательных бюллетеней, бюллетеней для голосования на референдуме, открепительных удостоверений; 

ст. 142.1 УК РФ "Фальсификация итогов голосования"

ФЗГД ст.84: "
1. Участковая избирательная комиссия оформляет свои решения об итогах голосования на соответствующем избирательном участке двумя протоколами: протоколом N 1 - об итогах голосования по одномандатному избирательному округу и протоколом N 2 - об итогах голосования по федеральному избирательному округу (далее также - протоколы участковой избирательной комиссии об итогах голосования).

2. Протоколы участковой избирательной комиссии об итогах голосования могут быть составлены в электронном виде. Особенности передачи участковыми избирательными комиссиями в вышестоящие избирательные комиссии протоколов об итогах голосования, составленных в электронном виде, приема таких протоколов вышестоящими избирательными комиссиями и ввода содержащихся в этих протоколах данных в ГАС "Выборы" устанавливаются Центральной избирательной комиссией Российской Федерации.

3. В случае, если протоколы участковой избирательной комиссии об итогах голосования оформляются на бумажном носителе, каждый из них составляется, как правило, на одном листе. Если протокол составлен более чем на одном листе, каждый лист должен быть пронумерован, подписан всеми присутствующими членами участковой избирательной комиссии с правом решающего голоса и заверен печатью участковой избирательной комиссии. Каждый протокол должен содержать:
1) номер экземпляра протокола;
2) название выборов, дату голосования, наименование избирательного округа, а для одномандатного избирательного округа также его номер;
3) слово "Протокол";
4) адрес помещения для голосования с указанием номера избирательного участка;
5) следующие строки протокола:
а) строка 1: число избирателей, внесенных в список избирателей на момент окончания голосования;
б) строка 2: число избирательных бюллетеней, полученных участковой избирательной комиссией;
в) строка 3: число избирательных бюллетеней, выданных избирателям, проголосовавшим досрочно;
г) строка 4: число избирательных бюллетеней, выданных участковой избирательной комиссией избирателям в помещении для голосования в день голосования;
д) строка 5: число избирательных бюллетеней, выданных избирателям, проголосовавшим вне помещения для голосования в день голосования;
е) строка 6: число погашенных избирательных бюллетеней;
ж) строка 7: число избирательных бюллетеней, содержащихся в переносных ящиках для голосования;
з) строка 8: число избирательных бюллетеней, содержащихся в стационарных ящиках для голосования;
и) строка 9: число недействительных избирательных бюллетеней;
к) строка 10: число действительных избирательных бюллетеней;
л) строка 11: число открепительных удостоверений, полученных участковой избирательной комиссией;
м) строка 12: число открепительных удостоверений, выданных участковой избирательной комиссией избирателям на избирательном участке до дня голосования;
н) строка 13: число избирателей, проголосовавших по открепительным удостоверениям на избирательном участке;
о) строка 14: число погашенных неиспользованных открепительных удостоверений;
п) строка 15: число открепительных удостоверений, выданных избирателям территориальной избирательной комиссией;
р) строка 16: число утраченных открепительных удостоверений;
с) строка 17: число утраченных избирательных бюллетеней;
т) строка 18: число избирательных бюллетеней, не учтенных при получении.

4. В строку 19 и последующие строки протокола N 1 вносятся фамилии, имена и отчества внесенных в избирательный бюллетень зарегистрированных кандидатов в алфавитном порядке, а при совпадении фамилий, имен и отчеств - иные данные о таких кандидатах и число голосов избирателей, поданных за каждого зарегистрированного кандидата.

5. В строку 19 и последующие строки протокола N 2 вносятся наименования политических партий, зарегистрировавших федеральные списки кандидатов, в порядке их размещения в избирательном бюллетене и число голосов избирателей, поданных за каждый федеральный список кандидатов.

6. Каждый протокол участковой избирательной комиссии об итогах голосования должен содержать:
1) сведения о количестве поступивших в участковую избирательную комиссию в день голосования и до окончания подсчета голосов избирателей жалоб (заявлений), прилагаемых к протоколу. Если в жалобе (заявлении) указывается на нарушения настоящего Федерального закона, иных федеральных законов при проведении голосования как по федеральному избирательному округу, так и по одномандатному избирательному округу, такая жалоба (такое заявление) прилагается к протоколу N 1 и учитывается в его соответствующей графе, а к протоколу N 2 прилагается копия этой жалобы (этого заявления);
2) фамилии и инициалы председателя, заместителя председателя, секретаря и других членов участковой избирательной комиссии с правом решающего голоса и их подписи (если протокол составлен более чем на одном листе, - на каждом листе протокола);
3) дату и время (часы и минуты) подписания протокола (если протокол составлен более чем на одном листе, - на каждом листе протокола);
4) для протокола, составленного на бумажном носителе, - печать участковой избирательной комиссии (если протокол составлен более чем на одном листе, - на каждом листе протокола).

7. Числа, указанные в частях 3 - 5 настоящей статьи, вносятся в протоколы участковой избирательной комиссии об итогах голосования цифрами и прописью."
